import logo from './logo.svg';
import React,{ Component } from 'react';
import './App.css';
import nav_header from './nav/nav_header';
import nav_middle from './nav/nav_middle';

function App() {
  return (
    <div className="App">
      <nav_header/>
      <nav_middle/>
    </div>
  );
}

export default App;
